import React, {useEffect, useState} from 'react';

const App = () => {
  const [backendData, setBackendData] = useState([{}]);

  useEffect(async () => {
    const response = await fetch("/api");
    const data = response.json();

    setBackendData(data);
  }, []);

  return (
    <div>
      {typeof backendData.users === 'undefined' ? (
        <p>Loading...</p>
       ) : (
         backendData.map((user, i) => {
           <p key={i}>{user}</p>
         })
       ) 
      }
    </div>
  );
}
